import React from 'react';
import CarCard from './CarCard';
import './CarList.css';

function CarList({ cars }) {
  return (
    <div className="car-list">
      {cars.length === 0 ? (
        <p>No cars found</p>
      ) : (
        cars.map((car) => (
          <CarCard key={car._id} car={car} />
        ))
      )}
    </div>
  );
}

export default CarList;
